import { Container } from "@mui/material";
import { Box } from "@mui/system";

export default function CryptoPage(){
  return(
    <>
    <Container>
       <Box>
       <Link onClick={(event) => navigateToLink(event, "/")}> Home</Link>
        <Link onClick={(event) => navigateToLink(event, "/crypto-page")}> Crypto</Link>
       </Box>
      </Container>
    </>
  )
}
